import React, {Component} from 'react';
import {Input, Form, FormGroup, Button, Label} from 'reactstrap';

class Register extends Component {
    render() {
        return (
            <div className="register">
                <Form>
                    <FormGroup>
                        <Label for="fullname">Full name:</Label>
                        <Input type="text" name="fullname" id="fullname" placeholder="Name"/>
                    </FormGroup>
                    <FormGroup>
                        <Label for="email">Email:</Label>
                        <Input type="email" name="email" id="email" placeholder="Email address"/>
                    </FormGroup>
                    <FormGroup>
                        <Label for="city">City:</Label>
                        <Input type="text" name="city" id="city" placeholder="City">
                            <option value="Baku">Baku</option>
                            <option value="Nakhchivan">Nakhchivan</option>
                            <option value="Gence">Gence</option>
                            <option value="Shusha">Shusha</option>
                        </Input>
                    </FormGroup>
                    <FormGroup>
                        <Input type="Register"/>
                    </FormGroup>
                </Form>
            </div>
        );
    }
}

export default Register;
